NEW便利なトレー付踏み台　トレー付き脚立　3段　<br><table width="600" border="0" cellspacing="0" cellpadding="0"><tr><td colspan="2"><table width="600" border="0" cellspacing="0" cellpadding="5"><tr><td bgcolor="#999999"><font color="#FFFFFF" size="5"><strong>　NEW　便利なトレー付踏み台</strong></font><br /><font color="#FFFFFF">トレイ付脚立３段　机が付いて作業がしやすい踏み台　はしご　きゃたつ　</font></td></tr></table><br /></td></tr><tr><td colspan="2" align="center"><img src="http://image.rakuten.co.jp/matsucame/cabinet/wat-07/wat2586-01.jpg" border="0" /><br /><br /><br /></td></tr><tr><td colspan="2"><table width="560" border="1" cellspacing="0" cellpadding="10" bordercolor="#663300"><tr><td><font size="2" face="ＭＳ ゴシック, MS Gothic, Osaka－等幅, Osaka-mono, monospace"><font color="#663300"><strong>高所作業もその場でラクラク！<br />机が付いた便利な踏み台</strong></font><br /><br />道具を持って脚立を昇り降り…<br />そんなツライ高所作業もコレで解消できる、お掃除道具の決定版！<br />トレーに掃除機をのせて使えばエアコン掃除もラクラク！<br />電球置き場もあり、電球の交換も安全に行えます。<br /><br />●お部屋の景観を損なわないベージュカラーが人気<br /><br />●もち手は太さがあるのでバランスを崩したときでもしっかり体を支えます。<br /><br />●踏み板はしっかりしたスチール製で足元の安全を確保！</font></td></tr></table><br /><br /><br /></td></tr><tr><td width="202" align="center"><img src="http://image.rakuten.co.jp/matsucame/cabinet/wat-07/wat2586-00.jpg" width="200" border="0" /></td><td width="398" align="center"><table style="font-size:10pt;" width="398" border="1" cellspacing="0" cellpadding="5"><tr align="center"><td width="91">商品名</td><td width="281">便利なトレー付踏み台</td></tr><tr align="center"><td>本体サイズ</td><td>使用時：幅53×奥行75×高さ124cm<br />収納時：幅：53×奥行9×高さ138cm</td></tr><tr align="center"><td>本体重量</td><td>約6.8kg</td></tr><tr align="center"><td>材質</td><td>スチール、ポリプロピレン</td></tr><tr align="center"><td>区分</td><td>雑貨</td></tr><tr align="center"><td>広告文責</td><td>株式会社マツムラカメラ　076-242-1122</td></tr></table></td></tr></table><br><br><img src="http://image.rakuten.co.jp/esteyou/cabinet/img-2/pre2.gif"><br><br><br /><img src="http://www.rakuten.ne.jp/gold/matsucame/pic_data/koshihikari.jpg" /><br><br><br><br><br><font color="#ff0000" size="2">※おまけはお一人様につき１点となります</font><br><br><table width="400" border="1" cellspacing="0" cellpadding="3"><tr><td><font size="2">通販　口コミ　クチコミ　レビュー<br /><a style="text-decoration:none" href="http://item.rakuten.co.jp/matsucame/wat2586/"><font color="#000000">便利なトレー付踏み台　トレー付脚立　3段</font></a></font></td></tr></table><br />　<br>ニュー便利なトレー付き踏み台　トレー付き脚立　3段　<br>送料無料　（北海道・沖縄や離島や僻地は別途です）<br><br><a href="http://my.bookmark.rakuten.co.jp/?func=reg&amp;svid=101&amp;shop_bid=205798&amp;iid=10035565&amp;itype=1" target="_blank"><img src="http://image.rakuten.co.jp/nihonnett/cabinet/001/okiniiri.gif" width="700" height="60" border="0"></a><br><br><div style="color:#666; font-size:10px; width:500px;">母の日 ギフト 父の日 ギフト 敬老の日 ギフト クリスマス ギフト お正月 子供の日 ギフト バレンタインデー ギフト ホワイトデー ギフト 可愛い おしゃれ オシャレ パーティー 入学祝い ギフト 卒業祝い ギフト 結婚記念日 ギフト お歳暮 ギフト お中元 旧正月 春節 お誕生日 などのプレゼントに<br><br><u>大変申し訳ございませんが のし 包装は対応いたしておりません。</u></div><center><img border="0" src="http://image.rakuten.co.jp/matsucame/cabinet/00433839/shobun-bana.jpg" width="600"><br><br></center>

